INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1001, 1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, "春咲 ひより", 0, 1.4, 0, 0, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 2, 0, "お！\nあそこに困ってそうな人発見！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1002, 1, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, "草野 優衣", 0, 1.4, 0, 0, 1, "みんなみたいに\nわたしも強くならなきゃ", 0, 2, 0, "大切な人を\n守れるようになりたい…って");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1003, 1, "少しは磨かれると思いますよ。", 1, "士条 怜", 0, 1.4, 0, 0, 1, "フェンシングを始めてみては？", 0, 2, 0, "キミに必要な集中力と感性が");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1004, 1, "みそぎはねぇ、\nかくれんぼやりたい！", 1, "穂高 みそぎ", 0, 1.5, 0, 0, 1, "ねぇ、にいちゃん！", 0, 2, 0, "今日はなにして遊ぶ？");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1006, 1, "私といっしょに…\nいかない？", 1, "風宮 あかり", 0, 1.4, 0, 0, 1, "風宮あかりです", 0, 2, 0, "ねぇ…");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1007, 1, "食べ物の恨みは怖いのー", 1, "出雲 宮子", 0, 1.5, 0, 0, 1, "出雲宮子なのー", 0, 2, 0, "プリンたべたいのー");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1008, 1, "いいよ。\n見られることは運命さ…", 1, "虹村 雪", 0, 1.4, 0, 0, 1, "ボクは虹村雪。", 0, 2, 0, "キミもボクの美貌に\n吸い寄せられたんだね。");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1009, 1, "人呼んで「疾風の冥姫」!!", 1, "柊杏奈", 0, 1.4, 0, 0, 1, "フッ…聞いて後悔するがいい！", 0, 2, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1010, 1, "ほんまおおきにやわ～♪", 1, "姫宮 真歩", 0, 1.5, 0, 0, 1, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 2, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1011, 1, "ここで会ったが\n100年目～！", 1, "衣之咲 璃乃", 0, 1.4, 0, 0, 1, "衣之咲璃乃です！", 0, 2, 0, "生き別れたお兄ちゃんを探して\n三千世界！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1012, 1, "…って、お願い！\n誰にも言わないでおいて～！", 1, "柏崎 初音", 0, 1.4, 0, 0, 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 2, 0, "ち、超能力って…\n何のことかな～？");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1016, 1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, "美波 鈴奈", 0, 1.4, 0, 0, 1, "ちょす！\n美波鈴奈だよ～♪", 0, 2, 0, "一応カリスマ読モJKやってまっす！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1017, 1, "でも、沖縄もとってもいいとこさー", 1, "喜屋武 香織", 0, 1.4, 0, 0, 1, "はいたーい。\n喜屋武香織さー。", 0, 2, 0, "東京は遊園地みたいなところさー");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1018, 1, "イオちゃんって呼んでね。", 1, "支倉 伊緒", 0, 1.4, 0, 0, 1, "支倉伊緒です。", 0, 2, 0, "先生って呼ばれるのは\nくすぐったいから");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1020, 1, "ミミをおいてかないでぇ～", 1, "茜 ミミ", 0, 1.5, 0, 0, 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 2, 0, "あ！/\お兄ちゃ～ん\nまってよ～");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1021, 1, "ふぇぇぇぇぇん……", 1, "栗林 くるみ", 0, 1.5, 0, 0, 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 2, 0, "あの……\nふぇ……");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1022, 1, "なんてありがとうございます！", 1, "風宮 より", 0, 1.4, 0, 0, 1, "風宮よりです。\nあああああ！", 0, 2, 0, "こんな私に貴重な時間を\n割いていただき、");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1023, 1, "私こっち行きたいー\nね、早く早くー", 1, "北条 綾音", 0, 1.5, 0, 0, 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 2, 0, "おにいちゃんどこいくの？\nえ？");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1025, 1, "これて何か違う…\nあああすみません！", 1, "天野 すずめ", 0, 1.4, 0, 0, 1, "わっ…わっ…私、\n天野すずめといいます！", 0, 2, 0, "ふ、不束者ですが\nどうぞ末永く…って、");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1027, 1, "離しませんわ………\n絶対に…!!", 1, "倉石 恵理子", 0, 1.4, 0, 0, 1, "……クスクス…私は\n…倉石恵理子……", 0, 2, 0, "あなたは…運命の……\n伴侶……");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1028, 1, "…そうでしょ？？", 1, "佐々木 咲恋", 0, 1.4, 0, 0, 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 2, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1029, 1, "あはは、\n私もまだまだだなぁ～", 1, "桜井 望", 0, 1.4, 0, 0, 1, "桜井望だよ！\nよろしくねっ", 0, 2, 0, "ぇっと…\nキミ、私のこと知らないの?!");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1030, 1, "ショーグン、\nワタシと一緒に天下統一デース！", 1, "ニノン・ジュベール", 0, 1.4, 0, 0, 1, "デケデケデンっ！", 0, 2, 0, "初めまして、\n私はニノン・ジュベール申すデス！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1031, 1, "おかしいですね……", 1, "上喜 しのぶ", 0, 1.4, 0, 0, 1, "上喜しのぶです。\n手元のドクロが父です。", 0, 2, 0, "でもって私の隣にいるのが……\nえ、見えない？");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1033, 1, "そう、\nオラのボケに突っ込める相方が…！", 1, "野戸まひる", 0, 1.5, 0, 0, 1, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 2, 0, "けんども\nそれには足りないモンが…");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1034, 1, "ちょ\nちょっと一杯飲んできます…！", 1, "綾瀬 ゆかり", 0, 1.4, 0, 0, 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 2, 0, "ちょっと緊張しちゃって…");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1036, 1, "これ以上お話しすることは…\nないです！", 1, "氷川 鏡華", 0, 1.5, 0, 0, 1, "氷川鏡華…です", 0, 2, 0, "知らない人とは話しちゃいけないので");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1038, 1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, "柏崎 栞", 0, 1.4, 0, 0, 1, "柏崎…栞です。", 0, 2, 0, "……あ、アラーム。");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1040, 1, "野に咲く花が、\n唯一の話相手です。", 1, "双葉 碧", 0, 1.4, 0, 0, 1, "ふ、双葉碧です。", 0, 2, 0, "私、一人も友達がいなくて……");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1042, 1, "そう思っています。", 1, "三角 千歌", 0, 1.4, 0, 0, 1, "三角千歌です。", 0, 2, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1043, 1, "う、疑ってすまなかったな…", 1, "安芸 真琴", 0, 1.4, 0, 0, 1, "安芸真琴だ。", 0, 2, 0, "あぁ？\nお前のそいつの仲間か？");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1044, 1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, "イリヤ・オーンスタイン", 0, 1.4, 0, 0, 1, "わらわこそは夜を総べる者！", 0, 2, 0, "生けとし生ける全ての者よ！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1045, 1, "ｌク、クウカに何かご用ですか!?", 1, "遠見 空花", 0, 1.4, 0, 0, 1, "そこで騎士は妖精を乱暴に……", 0, 2, 0, "ぐふふふふ……はっ！");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1046, 1, "う～ん…\n猫ってホントに最高にゃ～♪", 1, "宮坂たまき", 0, 1.4, 0, 0, 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 2, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1048, 1, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, "大神 美冬", 0, 1.4, 0, 0, 1, "大神美冬よ！", 0, 2, 0, "それでは早速クエストに…");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1049, 1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, "星野静流", 0, 1.4, 0, 0, 1, "星野静流だよ！", 0, 2, 0, "クエストもバトルも\n掃除も洗濯も");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1050, 1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, "玉泉美咲", 0, 1.5, 0, 0, 1, "アタシは玉泉美咲。", 0, 2, 0, "見ての通りの\nセクシー美少女で");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1052, 1, "？？？？", 1, "リマ", 0, 1.4, 0, 0, 1, "？？？", 0, 2, 0, "？？？？");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1053, 1, "そ、そこまでいうなら\nもらってやる", 1, "モニカ・ヴァイスヴィント", 0, 1.5, 0, 0, 1, "モニカ・ヴァイスヴィントだ。", 0, 2, 0, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1058, 1, "そ、そこまでいうなら\nもらってやる", 1, "ペコリーヌ", 0, 1.5, 0, 0, 1, "モニカ・ヴァイスヴィントだ。", 0, 2, 0, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1059, 1, "そ、そこまでいうなら\nもらってやる", 1, "コッコロ", 0, 1.5, 0, 0, 1, "モニカ・ヴァイスヴィントだ。", 0, 2, 0, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1060, 1, "そ、そこまでいうなら\nもらってやる", 1, "キャル", 0, 1.5, 0, 0, 1, "モニカ・ヴァイスヴィントだ。", 0, 2, 0, "菓子でつろうなどと\n稚拙な策を……");
